CREATE DEFINER=`root`@`localhost` PROCEDURE `spprocestrat`(idcli INT)
BEGIN

SELECT 
    Producto AS idpro,
    nompro AS descripcion,
    (SELECT precio FROM tbpro10 WHERE idpro = Producto) AS precio_unitario
FROM (
    SELECT 
        f1.idcli AS Cliente,
        f2.idpro AS Producto,
        p.nompro,
        COUNT(*) AS VecesCompradas,
        ROW_NUMBER() OVER (PARTITION BY f1.idcli ORDER BY COUNT(*) DESC) AS Ranking
    FROM 
        tbfacdet21 f2, 
        tbfacmae20 f1, 
        tbpro10 p,
        tbcli03 c
    WHERE 
        f2.nofac = f1.nofac
        AND p.idpro = f2.idpro
        AND f1.idcli = idcli
    GROUP BY 
        f1.idcli, f2.idpro, p.nompro
) AS Subconsulta
WHERE 
    Ranking <= 10
ORDER BY 
    Ranking;

END ;;
DELIMITER ;
